from bisect import bisect_right,bisect_left
class Solution(object):
    def waysToSplit(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        n = len(nums)
        ls =[0]*(n+1)
        for i in range(n):
            ls[i+1] = ls[i] + nums[i]
        sm = ls[-1]
        cnt =0
        #print(ls)
        for i in range(1,n-1):
            fst = ls[i]
            #print(fst)
            if fst *3 > sm :
                continue
            mx = (sm - fst)//2
            sidx =max( bisect_left(ls,fst*2 ), i+1)
            midx =min( bisect_right(ls,fst+mx),n)
            #print(sidx,midx,fst,mx)
            cnt += midx -sidx
        #print(cnt)
        return cnt%(10**9 +7)

